import './App.css';
import { Switch, Route, Link } from 'react-router-dom';

import CountryTable from './components/CountryTable';

function App() {
  return (
    <div className="App">

      <Switch>
        <Route></Route>
        <CountryTable />
      </Switch>

    </div>
  );
}

export default App;
